// AboutPage.js
import React from 'react';
import Header from './Header';
import Footer from './Footer'

const AboutPage = () => {
  return (
    <div>
      <Header />
      <ImageSection />
      <TextSection />
      <IconSection />
      <TextSection />
      <TextSection />
      <TextSection />
	  <TwoColumnSection />
      <Footer />
    </div>
  );
};

const ImageSection = () => {
  return (
    <section className=" w-100 h-100 d-inline-block" style={imageSectionStyle}>
      <img src="path/to/small/image.jpg" alt="Description" style={imageStyle} />
      <h3 className='text-white'>“Discover, Apply and Ease your Budget”</h3>
    </section>
  );
};

const TextSection = () => {
  return (
    <section style={textSectionStyle}>
      <div className=" w-100 h-100 d-inline-block">
        <h2>How to do it?</h2>
      </div>
    </section>
  );
};

const IconSection = () => {
  return (
    <section style={iconSectionStyle}>
      <div className=" w-100 h-100 ">
        <div class="container">
          <div class="row">
            <div class="col-sm" style={iconStyle}>
              One of three columns
              <p>Look for the loan or scholarship that best suits you</p>
            </div>
            <div class="col-sm" style={iconStyle}>
              One of three columns
            </div>
            <div class="col-sm" style={iconStyle}>
              One of three columns
            </div>
            <div class="col-sm" style={iconStyle}>
              One of three columns
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

const TwoColumnSection = () => {
  return (
    <section style={sectionStyle}>
      <div style={leftColumnStyle}>
        <h3>Left Column</h3>
        <p>Your left column content goes here.</p>
      </div>
      <div style={rightColumnStyle}>
        <img
          src="path/to/your/image.jpg"
          alt="Description"
          style={columnImageStyle}
        />
      </div>
    </section>
  );
};

// Styles
const imageSectionStyle = {
  textAlign: 'center',
  padding: '2rem',
  backgroundColor: '#e0e0e0',
};

const imageStyle = {
  maxWidth: '100%',
  height: 'auto',
};

const textSectionStyle = {
  textAlign: 'center',
  padding: '2rem',
  backgroundColor: '#f0f0f0',
};

const iconSectionStyle = {
  display: 'flex',
  justifyContent: 'center',
  padding: '2rem',
  backgroundColor: '#e0e0e0',
};

const iconStyle = {
  margin: '0 1rem',
  textAlign: 'center',
  width: '50px',
  height: '50px',
  lineHeight: '50px',
  backgroundColor: '#333',
  color: '#fff',
};
const sectionStyle = {
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'space-between',
  padding: '2rem',
  backgroundColor: '#f0f0f0',
};

const leftColumnStyle = {
  flex: '0 0 70%',
};

const rightColumnStyle = {
  flex: '0 0 30%',
};

const columnImageStyle = {
  maxWidth: '100%',
  height: 'auto',
};
// Add responsive styles
const responsiveStyles = {
  headerStyle: {
    fontSize: '1.5rem',
  },
  imageSectionStyle: {
    padding: '1rem',
  },
  textSectionStyle: {
    padding: '1rem',
  },
  iconSectionStyle: {
    flexDirection: 'column',
  },
  iconStyle: {
    margin: '1rem 0',
  },
};

// Apply responsive styles using media queries
Object.keys(responsiveStyles).forEach(key => {
  const style = responsiveStyles[key];
  const mediaQuery = `@media (max-width: 768px) { ${key} { ${Object.entries(style).map(([property, value]) => `${property}: ${value};`).join(' ')} } }`;
  const styleTag = document.createElement('style');
  styleTag.type = 'text/css';
  styleTag.appendChild(document.createTextNode(mediaQuery));
  document.head.appendChild(styleTag);
});


export default AboutPage;
